import React from "react";
import ReactApexChart from "react-apexcharts";

const heatmapData = [
  [1, 10, 10, 10, 10, 10, 10, 10, 10, 10],
  [1, 1, 1, 1, 1, 10, 10, 10, 10, 10],  
];

const HeatMapChart = () => {
  const options = {
    chart: {
      type: "heatmap",
    },
    dataLabels: {
      enabled: false,
    },
    colors: ["#FEDF89", "#F79009", "#B54708", "#7A2E0E"],
  };

  const series = [
    {
      name: "",
      data: heatmapData[0],
    },
    {
      name: "",
      data: heatmapData[0],
    },
    {
      name: "",
      data: heatmapData[0],
    },
    {
      name: "",
      data: heatmapData[0],
    },
    {
      name: "",
      data: heatmapData[0],
    },
    {
      name: "",
      data: heatmapData[1],
    },
    {
      name: "",
      data: heatmapData[1],
    },
    {
      name: "",
      data: heatmapData[1],
    },
    {
      name: "",
      data: heatmapData[1],
    },
    {
      name: "",
      data: heatmapData[1],
    },
  ];

  return (
    <div style={{ maxWidth: '200px', display: 'flex'}}>
      <ReactApexChart
        options={options}
        series={series}
        type="heatmap"
        height={200}
      />
    </div>
  );
};

export default HeatMapChart;
